use serde::{Deserialize, Serialize};#[derive(Deserialize, Debug)]pub struct Db {    pub db_type: String,    pub key_vaule_max_open_files: u64,    pub key_value_db_path: String,    pub ledger_db_path: String,    pub account_db_path: String,    pub rational_string: String,    pub rational_db_type: String,    pub tmp_path: String,    pub async_write_sql: bool,    pub async_write_kv: bool,}impl Clone for Db {    fn clone(&self) -> Self {        Self {            db_type: self.db_type.clone(),            key_vaule_max_open_files: self.key_vaule_max_open_files,            key_value_db_path: self.key_value_db_path.clone(),            ledger_db_path: self.ledger_db_path.clone(),            account_db_path: self.account_db_path.clone(),            rational_string: self.rational_string.clone(),            rational_db_type: self.rational_db_type.clone(),            tmp_path: self.tmp_path.clone(),            async_write_sql: self.async_write_sql,            async_write_kv: self.async_write_kv,        }    }}